 * when it is changed.
 *
 * If you are unfamiliar with LESS, you can read more about it here:
 * http://www.lesscss.org
 */
.invisible-character {
  color: transparent;
}
.source .invisible-character {
  color: rgba(255, 255, 255, 0.2);
}
.source .invisible-character.hard-tab {
  position: relative;
  color: transparent;
}
.source .invisible-character.hard-tab:before {
  position: absolute;
  top: 50%;
  left: 1px;
  right: 1px;
  content: "";
  border-bottom: 1px solid rgba(255, 255, 255, 0.2);
}
